"use client";

import { useRef, useState } from "react";
import toast from 'react-hot-toast';
import Loader from '../loader/Loader';
import getCurrentTime from '@/utils/getCorrentTime';
import IconOptions from '../options/IconOptions';
import IOSOption from '../options/IOSOption';
import getPicture from '@/utils/getPicture';
import Image from "next/image";
import { KrakenProductEncoded } from "@/utils/encodedFonts/KrakenProductEncoded";

const View33 = () => {

    const screenshotRef = useRef(null);
    const [isLoading, setIsLoading] = useState(false);
    const pageName = "VIEW 33";

    const [data, setData] = useState({
        amount1: "50",
        amount2: "50",

    });

    const onChangeHandler = (e) => {
        setData({ ...data, [e.target.name]: e.target.value });
    }

    const [imageDimension, setImageDimension] = useState("50");

    const [time, setTime] = useState("9:34");
    const [network, setNetwork] = useState(4);
    const [net, setNet] = useState("wifi");
    const [isBattery, setIsBattery] = useState(true);
    const [battery, setBattery] = useState(50);
    const [bgColor, setBgColor] = useState("#ffffff");
    const [isOption, setIsOption] = useState(true);
    const [isIOS, setIsIOS] = useState(true);
    const [preview, setPreview] = useState("");
    const [isPreview, setIsPreview] = useState(false);

    const fetchCurrentTime = async () => {
        const timeValue = await getCurrentTime();
        setTime(timeValue);
    }

    const takeScreenshot = async () => {
        await getPicture(
            setPreview,
            setIsPreview,
            screenshotRef,
            setIsLoading,
            toast,
            0,
            1.2,
            0,
            1.2
        );
    }

    return (
        <>
            {isLoading ? <Loader /> : <></>}
            {
                isPreview
                    ?
                    <>
                        <div className="show_preview" onClick={() => setIsPreview(false)}>
                            <div className="inner_preview" onClick={(e) => e.stopPropagation()}>
                                <Image
                                    src={preview}
                                    height={100}
                                    width={100}
                                    alt="pre"
                                />
                            </div>
                        </div>
                    </>
                    :
                    <>
                    </>
            }
            <div className="bill-inner-view">
                <div className="bill-inner-view-childs">
                    <IconOptions
                        setImageDimension={setImageDimension}
                        setNetwork={setNetwork}
                        setNet={setNet}
                        setIsBattery={setIsBattery}
                        setBattery={setBattery}
                        setBgColor={setBgColor}
                        setIsOption={setIsOption}
                        setTime={setTime}
                        battery={battery}
                        isOption={isOption}
                        time={time}
                        bgColor={bgColor}
                        imageDimension={imageDimension}
                        fetchCurrentTime={fetchCurrentTime}
                        setIsIOS={setIsIOS}
                        isIOS={isIOS}
                    />
                    <div className="billing-mobile-wrapper" style={{
                        background: `${bgColor}`
                    }}>
                        <div
                            className="artboard"
                            ref={screenshotRef}
                            style={{
                                transform: `scale(${imageDimension / 100})`,
                            }}
                        >
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                xmlnsXlink="http://www.w3.org/1999/xlink"
                                viewBox="0 0 431 933.469"
                            >
                                <style>
                                    {
                                        KrakenProductEncoded
                                    }
                                </style>

                                <g
                                    id="Group_155"
                                    data-name="Group 155"
                                    transform="translate(-1046 -73.266)"
                                >
                                    <image
                                        xlinkHref="data:image/jpeg;base64,"
                                        id="b10"
                                        width="431"
                                        height="933.469"
                                        transform="translate(1046 73.266)"
                                    ></image>
                                    <path
                                        id="Rectangle_135"
                                        fill="#16171b"
                                        d="M0 0h37v28H0z"
                                        data-name="Rectangle 135"
                                        transform="translate(1405 571)"
                                    ></path>
                                    <path
                                        id="Rectangle_136"
                                        fill="#16171b"
                                        d="M0 0h37v28H0z"
                                        data-name="Rectangle 136"
                                        transform="translate(1429 660)"
                                    ></path>
                                    <text
                                        id="_50"
                                        fill="#f3f3f5"
                                        data-name="50"
                                        fontFamily="MicrosoftJhengHeiRegular, Microsoft JhengHei"
                                        fontSize="13"
                                        letterSpacing=".111em"
                                        transform="translate(1420 588)"
                                    >
                                        <tspan x="0" y="0">
                                            {data.amount1}
                                        </tspan>
                                    </text>
                                    <text
                                        id="_50-2"
                                        fill="#f3f3f5"
                                        data-name="50"
                                        fontFamily="MicrosoftJhengHeiRegular, Microsoft JhengHei"
                                        fontSize="13"
                                        letterSpacing=".111em"
                                        transform="translate(1443 682)"
                                    >
                                        <tspan x="0" y="0">
                                            {data.amount2}
                                        </tspan>
                                    </text>
                                    <g id="Group_153" data-name="Group 153" transform="translate(23 -22)">
                                        <path
                                            id="Rectangle_104"
                                            fill="#100f14"
                                            d="M0 0h410v28H0z"
                                            data-name="Rectangle 104"
                                            transform="translate(1034 998)"
                                        ></path>
                                        <rect
                                            id="Rectangle_105"
                                            width="156"
                                            height="6"
                                            fill="#fff"
                                            data-name="Rectangle 105"
                                            rx="3"
                                            transform="translate(1161 1015)"
                                        ></rect>
                                    </g>
                                    <path
                                        id="Rectangle_137"
                                        fill="#16171b"
                                        d="M0 0h410v35H0z"
                                        data-name="Rectangle 137"
                                        transform="translate(1057 85)"
                                    ></path>
                                </g>
                            </svg>

                            <IOSOption
                                battery={battery}
                                isOption={isOption}
                                time={time}
                                network={network}
                                net={net}
                                isBattery={isBattery}
                                iconPadding={`2rem 5rem 0rem 7rem`}
                                isIOS={isIOS}
                            />
                        </div>
                    </div>
                </div >

                <div className="bill-inner-view-childs">
                    <h4 className="section-heading">INPUTS - {pageName}</h4>
                    <div className="screenshot-btn">
                        <button onClick={() => takeScreenshot()}>Screenshot <i className="fa fa-copy"></i></button>
                    </div>
                    <div className="global_form_wrapper">
                        <div className="global_form_inner">
                            <label>BANK</label>
                            <input
                                type="text"
                                value={data.amount1}
                                name="amount1"
                                onChange={(e) => onChangeHandler(e)}
                            />
                            <input
                                type="text"
                                value={data.amount2}
                                name="amount2"
                                onChange={(e) => onChangeHandler(e)}
                            />
                          
                        </div>



                    </div>
                </div>

            </div >
        </>
    )
}

export default View33